pragma solidity ^0.4.21;

import "./SafeMath.sol";
import "./ERC20.sol";
import "./Ownable.sol";


contract MintableToken is ERC20 {

    // uint256 totalSupply_;
    // mapping(address => uint) balances;
    bool public mintingFinished = false;

    event Mint(address indexed to, uint256 amount);
    event MintFinished();
    // event DestroyTokens(address indexed _from, uint256 _value);

    modifier canMint() {
        require(!mintingFinished);
        _;
    }

    function mint(address _to, uint256 _amount) canMint public returns (bool) {
        // totalSupply_ = SafeMath.add(totalSupply_, _amount);
        // balances[_to] = SafeMath.add(balances[_to], _amount);
        emit Mint(_to, _amount);
        emit Transfer(address(0), _to, _amount);
        return true;
    }

    function finishMinting() canMint public returns (bool) {
        mintingFinished = true;
        emit MintFinished();
        return true;
    }

    /*function destroyTokens(uint256 _amount) onlyOwner public {
        require(balances[msg.sender] >= _amount);

        balances[msg.sender] = SafeMath.sub(balances[msg.sender], _amount);
        totalSupply_ = SafeMath.sub(totalSupply_, _amount);

        emit DestroyTokens(msg.sender, _amount);
    }*/

}
